	if err = randomize.Struct(seed, &a, mtbSexDBTypes, false, strmangle.SetComplement(mtbSexPrimaryKeyColumns, mtbSexColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*DTBCustomer{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, dtbCustomerDBTypes, false, strmangle.SetComplement(dtbCustomerPrimaryKeyColumns, dtbCustomerColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*DTBCustomer{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddSexDTBCustomers(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if !queries.Equal(a.ID, first.SexID) {
			t.Error("foreign key was wrong value", a.ID, first.SexID)
		}
		if !queries.Equal(a.ID, second.SexID) {
			t.Error("foreign key was wrong value", a.ID, second.SexID)
		}

		if first.R.Sex != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Sex != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.SexDTBCustomers[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.SexDTBCustomers[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.SexDTBCustomers().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
